import React from "react";

import User from "../../api/User";

export default class Users extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      users: [],
    };
  }

  componentDidMount() {
    User.get().then(({ data }) => {
      this.setState({
        users: data,
      });
    });
  }

  users(){
      const {users} = this.state
      if(!users.length){
          return <tr><td colSpan="2">No user found</td></tr>
      }
      return users.map( user => (
          <tr>
              <td>{user._id}</td>
              <td>{user.username}</td>
          </tr>
      ))
  }

  componentWillUnmount() {}

  render() {
    return <h3>Users</h3>;
  }
}
